import React from 'react';
import PropTypes from 'prop-types';
import { Button } from 'antd';

const FollowBtn = ({ post }) => {
  (
    <>
      <Button>Follow</Button>
    </>
  );
};

FollowBtn.propTypes = {
  post: PropTypes.shape().isRequired,
};

export default FollowBtn;
